    return (
        <div className={styles.pizzaWrapper}>
        <h3 className={styles.pizzaTitle}>Our delicious Pizza</h3>
        <ul>{allPizzaMenu.map(pizza => {
            {id,                pizzaTitle,                price,                vegetarian,                image}
            return <li key={pizza.id}>{pizza.pizzaTitle}</li>
        })}
        </ul>
        </div>
    )

}
